import React from 'react';
import styled from 'styled-components'              

const Header = (props) => {
    return (

        <HeaderContainer>

        <HeaderIntro>
            <h1></h1>
            <p></p>

        </HeaderIntro>

        <HeaderImg>
            <img src={props.headerImage} alt='Header'/>
        </HeaderImg>

        </HeaderContainer>

        
    )
};

const HeaderContainer = styled.div`
margin-top: -22px;

`
const HeaderIntro = styled.div`

`

const HeaderImg = styled.div`
max-width: 100vw;
height: 400px;
opacity: 1;
transition: opacity 1s, background 1s;
background: #2a2a2a;

img {
    width:100%;
    height:100%;
    object-fit:cover;
}

`

export default Header;
